import React from 'react';
import { BrowserRouter as Router, Swicth, Route } from 'react-router-dom';

import { Homepage } from './pages';

function App() {

  return (
    <Router>
      <Swtich>
        <Route exact path="/" component={Homepage} /> 
      </Swtich>
    </Router>
  );

}

export default App;
